  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0000733 includes discrete
  sample and profile data collected from KNORR in the Davis Strait, Labrador Sea,
  North Atlantic Ocean, North Greenland Sea and Norwegian Sea from 1981-04-01 to 1981-10-19.
  These data include DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON (DIC),
  DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Partial pressure
  (or fugacity) of carbon dioxide - water, Potential temperature (theta), RADIUM ISOTOPES,
  SALINITY, SIGMA-T, TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope), WATER TEMPERATURE,
  phosphate and silicate. The instruments used to collect these data include CTD and
  bottle.nnThese data were collected by Taro Takahashi of Columbia University; Lamont-Doherty
  Earth Observatory and Peter Brewer and R.T. Williams of University of California
  - San Diego; Scripps Institution of Oceanography as part of the TTO-NAS data set.
  CDIAC associated the following cruise ID(s) with this data set: TTO-NAS\",\n\t\"owner_org\":
